import { Box } from '@mui/system'
import React from 'react'
import Button from '@mui/material/Button';

function Address() {
  return (
    <Box sx={{
        position:'relative',
        display:'flex',
        justifyContent:'space-between'
    }}>
        <Box>
            <Typography>Delivery to: Ananthu N A,689595<Button variant="contained" disabled>Home</Button></Typography>
            <Typography>Vishnupresadham,mampuzhakary,ramankary po,allapuzha,kerala</Typography>
        </Box>
        <Button variant="outlined" size="medium">change</Button>
    </Box>
  )
}

export default Address
